  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0155592 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise AMAT02RR in the
  North Pacific Ocean and South Pacific Ocean from 2005-09-03 to 2006-03-03. These
  data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
  COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
  These data were collected by Peter Lonsdale of University of California - San Diego;
  Scripps Institution of Oceanography as part of The Bend in the Louisville Hotspot
  Chain/IODP Expedition 330 Site Survey. The Lamont-Doherty Earth Observatory (LDEO)
  submitted these data to NCEI as part of the NSF sponsored Rolling Deck to Repository
  (R2R) program.nnThe ADCP data represent the raw and automated processed data set.
  Post processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
